export default (urlParams, values, type) => {
    if (type === 'POST'){
        return fetch('http://localhost:3001' + urlParams, {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: values
        });
    } else {
        return fetch('http://localhost:3001' + urlParams, {
            method: 'GET',
            
        })
    }
    
}
